import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import '.App//App.css';
//import Home from './pages/Home';
import List from './App/pages/List';

class App extends Component {
  render() {
    const App = () => (
      <div>
          <Route path='/' component={List}/>
      </div>
    )
    return(
      <App/>
    );
  }
}

export default App;
